import React, { useEffect, useState } from "react";
import SearchBoxStyled from "../styled/commonStyled/SearchBoxStyled";
import SearchStyled from "../styled/commonStyled/SearchStyled";
import { FaSearch } from "react-icons/fa";
import { Route, Routes, Link } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";
import getSearch from "../../redux/module/search";

const Search = () => {
  const [input, setInput] = useState("");
  const initInput = useSelector((state) => state.search.input);
  const dispatch = useDispatch();

  const handleKeyword = (e) => {
    setInput(e.target.value);
  };

  const handleClick = (e) => {
    dispatch(getSearch(input));
  };

  return (
    <SearchBoxStyled>
      <SearchStyled
        placeholder="Search"
        onChange={handleKeyword}
      ></SearchStyled>
      <FaSearch color="#7f8fa6" />
    </SearchBoxStyled>
  );
};

export default Search;
